import React from 'react';
import MyPosts from './MyPosts/MyPost';
import ProfileInfo from './ProfileInfo/ProfileInfo';

const Profile = (props) => {
    return (
        <div>
            <ProfileInfo />
            <MyPosts 
                posts={props.pageProfile.postsDt} 
                addPost={props.addPost}
                newPostText={props.pageProfile.newPostText}
                rewritePostText={rewritePostText} />
        </div>
    );
}

export default Profile;
